char *gbk2utf8(const uint8_t *data, size_t len) {
    uint32_t i = 0, j = 0;
    bool flg = false;
    int32_t count = 0;
    char *p_ret = NULL;
    uint8_t *p_cur = NULL;
    uint8_t *p_src = NULL;
    uint32_t p_len = 0;
    const uint8_t *cur = NULL;
    uint8_t buf[4] = {0};

    if ((NULL == data) || (len <= 0)) {
        return NULL;
    }

    if (!is_valid_gbk(data, len)) {
        return NULL;
    }

    p_len = ((len * 2) + 1);
    p_src = (uint8_t *)malloc(p_len);
    if (NULL == p_src) {
        goto __oops;
    }
    memset(p_src, 0, p_len);

    flg = true;

    for (i = 0, cur = data, p_cur = p_src; (i < len) && (p_cur < (p_src + p_len)) && flg; i++, cur++) {
        if ((*cur & 0x80) == 0) {
            /* 0xxxxxxx */
            *p_cur++ = *cur;
            continue;
        } else if ((*cur > 0x80) && (*cur < 0xFF)) {
            if ((i + 1) >= len) {
                flg = false;
                break;
            }
            if (0 != uni2utf8(gbk2uni(cur), buf)) {
                flg = false;
                break;
            }
            for (j = 0; j < sizeof(buf); j++) {
                if (0 == buf[j]) {
                    break;
                }
                *p_cur++ = buf[j];
            }
            i += 1;
            cur += 1;
        } else {
            flg = false;
            break;
        }
    }

    if (flg != false) {
        *p_cur = 0;
        p_ret = strdup((char *)p_src);
    }

__oops:
    if (p_src) {
        free(p_src);
        p_src = NULL;
    }

    return p_ret;
}

